mutation {
  createPlanetMutation(input: {
    	name: "tierra",
  		rotationPeriod:"2",	  		
    	orbitalPeriod: "2", 		
      diameter:"2",
    	climate:"2",
    	gravity:"2",
      terrain: "2",
    	surfaceWater:"1"
      population: "100",
  })
    {
    planet {
      name
      rotationPeriod
      orbitalPeriod
      diameter
      climate
      gravity    
      terrain
      surfaceWater
      population
    }
  }
}
